"""
Test a value against other values. Output rank and percentile of said value.
"""
from typing import List
from os import PathLike
import pandas
from pathlib import Path


def main(in_permutation_results: List[PathLike], in_actual_result: PathLike, out_table: PathLike) -> None:
    """
    Test an actual result against permutation results.

    Args:
        in_permutation_results (List[PathLike]): List of paths to the permutation results.
        in_actual_result (PathLike): Path to our actual result.
        out_table (PathLike): Where to write a table to help us check our work.
        out_result (PathLike): Where to write the results of this task. Should include percentile and rank.
    """
    actual_mean = pandas.read_csv(in_actual_result, index_col=0)["mean"][0]
    permutations_means = [pandas.read_csv(path, index_col=0)["mean"][0] for path in in_permutation_results]
    means_table = pandas.DataFrame({
        "path": in_permutation_results + ["actual mean"],
        "mean": permutations_means + [actual_mean]
    })

    means_table["rank"] = means_table["mean"].rank()
    means_table["percentile"] = means_table["mean"].rank(pct=True)
    means_table.sort_values("rank", ascending=True, inplace=True)

    make_parent_dir(out_table)
    means_table.to_csv(out_table)


def make_parent_dir(path: PathLike) -> None:
    """
    Create the parent directory for a path.
    """
    Path(path).parent.mkdir(exist_ok=True, parents=True)


